import React from 'react'

export default function ParaProject({source,titre,contenu}) {
  return (
    <div  className='flex flex-col items-start justify-evenly  my-0 mx-auto w-[90%]  '>
        <img style={{boxShadow:"   0 40px 60px -6px black"}} src={source} alt="" />
        <p className='text-[25px] font-bold opacity-[0.9] '> {titre} </p>
        <p className='text-[15px] opacity-[0.8]  '>{contenu} </p>
    </div>
  )
}
